import {
  ChildrenAppearance,
  ChildrenConstraint,
  ChildrenContainsConstraint,
  ChildrenNoneConstraint,
  NoConstraints,
  None,
} from './children-constraints';
import type { BlissNode } from './node';
import type { Bliss } from '.';

abstract class _BlissNodeDefinition<
  State,
  Config,
  Name extends string = never,
  CC extends ChildrenConstraint = never,
  ParseResult = never,
> {
  matcher!: (domNode: Node) => boolean;
  childrenConstraints?: CC;
  parser?: (this: BlissNode<any>, state: State, config: Config) => { result: ParseResult; state: State };

  /** dirty hack just for typing */
  __config!: Config;

  constructor(public name: Name, private bliss: Bliss<State, Config>, base?: BlissNodeDefinitionBase<State, Config>) {
    if (base) {
      Object.assign(this, base);
    }
  }

  /** Define a matcher which determines whether this Node definition targets a DOM Node or not. */
  match(matcher: (domNode: Node) => boolean) {
    this.matcher = matcher;
    return this;
  }

  /** Constrain this targeted Node to have no child Nodes. If it has any, the validation fails. */
  hasNoChildren(): BlissNodeDefinition<State, Config, Name, ChildrenNoneConstraint, ParseResult> {
    return new BlissNodeDefinition(this.name, this.bliss, { ...this, childrenConstraints: None });
  }

  /** Set no specific constraints on this targeted Node about child Nodes. */
  hasAnyChildren(): BlissNodeDefinition<State, Config, Name, NoConstraints, ParseResult> {
    return new BlissNodeDefinition(this.name, this.bliss, { ...this, childrenConstraints: NoConstraints });
  }

  /**
   * Constrain this targeted Node to have only certain types of child Nodes,
   * and constrain each type of children to appear certain times.
   */
  containsChildren<Def extends BlissNodeDefinitionBase<State, Config>>(
    ...contains: ChildrenAppearance<Def>[]
  ): BlissNodeDefinition<State, Config, Name, ChildrenContainsConstraint<Def>, ParseResult> {
    return new BlissNodeDefinition(this.name, this.bliss, { ...this, childrenConstraints: { contains } });
  }

  /**
   * Define a parser which takes the Node (as `this`), the current state, and the global config as parameters,
   * and returns the parse result and the modified state.
   */
  parse<ParseResult>(
    parser: (
      this: BlissNode<BlissNodeDefinition<State, Config, Name, CC, any>>,
      state: State,
      config: Config,
    ) => { result: ParseResult; state: State },
  ): BlissNodeDefinition<State, Config, Name, CC, ParseResult> {
    return new BlissNodeDefinition(this.name, this.bliss, { ...this, parser });
  }

  /** Define a parser which does nothing and returns the current state unmodified. */
  parseNoOp(): BlissNodeDefinition<State, Config, Name, CC, never> {
    return new BlissNodeDefinition(this.name, this.bliss, { ...this, parser: (state) => ({ state }) });
  }

  /**
   * Define a parser which does nothing,
   * and returns a constant value as the parse result and the current state unmodified.
   */
  parseConstant<T>(result: T): BlissNodeDefinition<State, Config, Name, CC, T> {
    return new BlissNodeDefinition(this.name, this.bliss, { ...this, parser: (state) => ({ result, state }) });
  }

  /**
   * Define a parser which does nothing,
   * and returns the Node's value as the parse result and the current state unmodified.
   */
  parseNodeValue(): BlissNodeDefinition<State, Config, Name, CC, string | null> {
    return new BlissNodeDefinition(this.name, this.bliss, {
      ...this,
      parser: function (state) {
        return { result: this.domNode.nodeValue, state };
      },
    });
  }

  /**
   * Define a parser which does nothing,
   * and returns the Node's textContent as the parse result and the current state unmodified.
   */
  parseTextContent(): BlissNodeDefinition<State, Config, Name, CC, string | null> {
    return new BlissNodeDefinition(this.name, this.bliss, {
      ...this,
      parser: function (state) {
        return { result: this.domNode.textContent, state };
      },
    });
  }

  /**
   * Define a parser which invokes every child's parser,
   * and returns their parse results all concatenated as a single string.
   */
  parseChildrenAndConcat(): BlissNodeDefinition<State, Config, Name, CC, string> {
    return new BlissNodeDefinition(this.name, this.bliss, {
      ...this,
      parser: function (state) {
        return (<BlissNode<any>[]>this.children).reduce(
          (acc, child) => {
            const { result, state } = child.parse(acc.state);

            if (result && typeof result !== 'string') {
              throw new Error(`Expected string, got ${typeof result}`);
            }

            return { result: result ? acc.result + result : acc.result, state };
          },
          { result: '', state },
        );
      },
    });
  }

  /** Define a parser which invokes every child's parser, and returns nothing. */
  parseChildrenAndDiscard(): BlissNodeDefinition<State, Config, Name, CC, never> {
    return new BlissNodeDefinition(this.name, this.bliss, {
      ...this,
      parser: function (state) {
        return {
          state: (<BlissNode<any>[]>this.children).reduce(({ state }, child) => child.parse(state), { state }).state,
        };
      },
    });
  }

  /** Register this Node definition to Bliss. */
  commit() {
    this.bliss.commit(this);

    return this;
  }
}

